(15, 9, 'VOTA2O814939', 'BAKPIA BASAH TAMANSARI KACANG HIJAU ISI 20', 'Isian kumbu asli dari kacang hijau pilihan , bahan bahan premium seperti margarin , butter dengan merk pilihan sehingga rasa lebih nikmat. \r\nKulit bakpia berlapis lapis dengan struktur yang lembut\r\nRasa kacang hijau , kumbu hitam dengan harga 30 k\r\nRasa coklat , keju  dengan harga 40 k\r\nPerpaduan yang pas dengan bahan bahan terbaik yang kami pilih ,tepung terigu,kacang hijau, gula, margarin, minyak masak dan garam sehingga menyajikan bakia yang pas dengan kulit tidak terlalu tebal dan tipis.\r\n\r\nBakpia Juwara Satoe Makanan khas kota Yogyakarta yang enak dan lembut : Isi 15 biji', 'WhatsApp_Image_2023-08-25_at_01_28_32.jpeg', '30000', '0.00', 20, 'kotak', 1, '2023-06-08 01:02:19'),
(16, 10, 'CO714884', 'BAKPIA KERING Kacang Hijau TAMANSARI PREMIUM ISI 20', 'Bakpia premium\r\nBakpia dengan cita rasa yang nikmat \r\nIsian kumbu terbuat dari bahan kacang hijau pilihan dipadu dengan bahan lainnya seperti margarine , butter , vanili  pilihan \r\nKulit berlapis lapis dengan rasa Krispy , sehingga menciptakan rasa Krispy diluar ,lembut didalam dengan rasa yang pas\r\nRasa kacang hijau , kumbu hitam  dengan harga 40 k\r\nRasa coklat , keju harga 50 k\r\nPerpaduan yang pas dengan bahan bahan terbaik yang kami pilih ,tepung terigu,Kumbu hitam, gula, margarin, minyak masak dan garam sehingga menyajikan bakia yang pas dengan kulit tidak terlalu tebal dan tipis.\r\n\r\nBakpia Juwara Satoe Makanan khas kota Yogyakarta yang enak dan lembut : Isi 15 biji', 'WhatsApp_Image_2023-08-25_at_01_28_32_(1).jpeg', '40000', '0.00', 10, 'kotak', 1, '2023-06-08 02:24:44'),
(17, 10, 'VOMBCCO12246', 'BAKPIA KERING KEJU PREMIUM ISI 20', 'Bakpia premium\r\nBakpia dengan cita rasa yang nikmat \r\nIsian kumbu terbuat dari bahan kacang hijau pilihan dipadu dengan bahan lainnya seperti margarine , butter , vanili  pilihan \r\nKulit berlapis lapis dengan rasa Krispy , sehingga menciptakan rasa Krispy diluar ,lembut didalam dengan rasa yang pas\r\nRasa kacang hijau , kumbu hitam  dengan harga 40 k\r\nRasa coklat , keju harga 50 k\r\nBakpia Juwara Satoe Makanan khas kota Yogyakarta yang enak dan lembut : Isi 15 biji\r\n\r\n Dibuat dengan bahan baku pilihan dan berkualitas tanpa bahan pengawet dan pewarna\r\n Ketahanan 5 hari sejak tanggal produksi, untuk ketahanan lebih lama simpan dalam kulkas, dan hangatkan sebelum dikosumsi\r\n Bakpia yang dikirim adalah produksi terbaru di hari pengiriman\r\n Packaging aman diterima sampai alamat', 'WhatsApp_Image_2023-08-25_at_01_28_32_(1)1.jpeg', '50000', '0.00', 30, 'kotak', 1, '2023-06-08 21:24:06'),
(18, 9, 'OENSO120527', 'BAKPIA BASAH PATHOK 871 KACANG HIJAU ISI 15', 'Bakpia kering dengan bermacam macam rasa pilihan seperti kacang hijau , aneka rasa ,coklat , strawberi , pandan , talas , dll\r\nCocok u/ oleh oleh jarak jauh karena masa kadaluwarsa yang panjang  selama 3 bulan\r\nSemua rasa bisa dibeli dengan harga yang sama 20 k', 'WhatsApp_Image_2023-08-25_at_01_28_32_(2).jpeg', '20000', '0.00', 20, 'kotak', 1, '2023-06-08 21:28:47'),
(19, 10, 'AR1O4R35689', 'BAKPIA KERING ANEKA RASA 871 ISI 15', 'Bakpia kering dengan bermacam macam rasa pilihan seperti kacang hijau , aneka rasa ,coklat , strawberi , pandan , talas , dll\r\nCocok u/ oleh oleh jarak jauh karena masa kadaluwarsa yang panjang  selama 3 bulan\r\nSemua rasa bisa dibeli dengan harga yang sama 20 k\r\nOleh-oleh ini berupa makanan ringan yang lembut, legit, enak dan cocok sekali dikonsumsi untuk camilan\r\n', 'WhatsApp_Image_2023-08-25_at_01_28_33.jpeg', '20000', '0.00', 0, 'kotak', 1, '2023-06-08 21:31:29');

